//import React from 'react'
import { useState, useEffect, memo } from "react";

const useFilter = (url) => {
  const [todos, setTodos] = useState([]);

  useEffect(() => {
    const fetchTodos = async () => {
      const res = await fetch(url);
      const data = await res.json();

      console.log(data);
      // console.log(arr);
      setTodos(data);
    };
    fetchTodos();
  }, [url]);

  return [todos];
};

export default useFilter;
